import React, { Fragment } from 'react';
import Die from './die'


function Row({id,rowRolls}) {
    console.log(`printing rowRolls ${id} ${rowRolls} `)

    let diceInRow = []
    let dieId = id
    let dieIdString = ''

    for (let [index, value] of rowRolls.entries()) {
        //console.log(`sending die index ${index+1} letter ${value}` )
        dieId = dieId+index
        dieIdString=`die_${dieId}`

        diceInRow.push(<td key={dieIdString}> 
                <Die id={dieIdString} roll={value}/>
            </td>)
    }

    console.log(`diceInRow ${id}`, diceInRow)

    return( diceInRow )
}

export default Row
